    "# **Model Specification**\n",
    "\n",
    "That our covariate space is low-dimensional is a fundamental strength of our modeling approach. Using too many covariates is dangerous; it is easy to overfit in our limited data setting (just 4,381 plays). We use [\"neural networks\"](https://www.ibm.com/think/topics/neural-networks) (NNs) to capture the complex, nonlinear relationships between the covariates and response. NNs in particular generalize well on small datasets (Olson et al., 2018). We train separate NNs for single- and two-safety plays, each with one hidden layer [\"(SiLU activation)\"](https://medium.com/@akp83540/silu-sigmoid-linear-unit-activation-function-d9b6845f0c81) and a sigmoid output, by minimizing [\"*logloss*\"](https://www.kaggle.com/code/dansbecker/what-is-log-loss) in R using Keras."
   ]
